# also generates the terms a(n), where n < 0. For example a(-1) = 1, a(-2)= -4, ...
def a(n):
    if n == 0:
       return 0
    elif n == 1:
       return 0
    elif n== 2:
       return 1
    elif n < 0:
       return expand(a(n+3)- 4*a(n+2) - 4*a(n+1))
